'use strict';
let ADXFeedMessage = require('./ADXFeedMessage.js');
class DxFeedSubscriptionData extends ADXFeedMessage {
    static get CHANNEL() { return "/service/sub"; }
    error;
    successful;
    id;
    getError() {
        return this.error;
    }
    getSuccessful() {
        return this.successful;
    }
    DxFeedHandshakeData() {
        this.channel = DxFeedSubscriptionData.CHANNEL;
    }
    getId() {
        return this.id;
    }
    static create(successful, id, error) {
        let dxFeedSubscriptionData;
        dxFeedSubscriptionData = new DxFeedSubscriptionData();
        dxFeedSubscriptionData.id = id;
        dxFeedSubscriptionData.successful = successful;
        dxFeedSubscriptionData.error = error;
        return dxFeedSubscriptionData;
    }
}
module.exports = DxFeedSubscriptionData
